import React from 'react';
const card = [
    { 'title': 'نمایشگاه', color: 'red' },
    { 'title': 'جستجوی پیشرفته' },
    { 'title': 'افزودن اگهی' },
    { 'title': 'صفحه ی شما' },
];

export default function index() {
    return (
        <div className="relative px-36">
            <div className="">
                <div className=" mt-32 flex justify-center items-center">
                    {card.map((item) => (
                        <div className="">
                            <div
                                className="bg-green-500 w-48 h-24 rounded-2xl flex justify-center items-center mr-10 text-sm"
                                style={{ backgroundColor: item.color, opacity: '30px' }}
                            >
                                <p>{item.title}</p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
}
